import Link from "next/link";
import Logo from "./Logo.js";

const Header = () => (
  <div className="header-container">
    <Link href="/">
      <img className="elis-logo" src="/img/logo.jpg" alt="logo" />
    </Link>
    <style jsx>{`
      .header-container {
        display: flex;
        justify-content: center;
      }
      .elis-logo {
        width: 10rem;
      }
    `}</style>
  </div>
);

export default Header;
